import React from 'react';
import { BiBriefcase, BiCardChecklist, BiBarChart, BiBinoculars, BiBrightnessHigh, BiCalendar4Week } from 'react-icons/bi';

const ServicesSection = () => {
  return (
    <section id="services" className="services">
      <div className="container section-title" data-aos="fade-up">
        <h2>Services</h2>
        <p>Necessitatibus eius consequatur ex aliquid fuga eum quidem sint consectetur velit</p>
      </div>

      <div className="container">
        <div className="row gy-4">
          <ServiceItem icon={<BiBriefcase />} title="Lorem Ipsum" description="Voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident" />
          <ServiceItem icon={<BiCardChecklist />} title="Dolor Sitema" description="Minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat tarad limino ata" />
          <ServiceItem icon={<BiBarChart />} title="Sed ut perspiciatis" description="Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur" />
          <ServiceItem icon={<BiBinoculars />} title="Magni Dolores" description="Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum" />
          <ServiceItem icon={<BiBrightnessHigh />} title="Nemo Enim" description="At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque" />
          <ServiceItem icon={<BiCalendar4Week />} title="Eiusmod Tempor" description="Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi" />
        </div>
      </div>
    </section>
  );
};

const ServiceItem = ({ icon, title, description }) => {
  return (
    <div className="col-lg-6" data-aos="fade-up">
      <div className="service-item d-flex">
        <div className="icon flex-shrink-0">{icon}</div>
        <div>
          <h4 className="title"><a href="services-details.html" className="stretched-link">{title}</a></h4>
          <p className="description">{description}</p>
        </div>
      </div>
    </div>
  );
};

export default ServicesSection;
